import { useEffect, useState } from "react";
import { useParams, useNavigate } from "react-router-dom";
import projectsJSON from "../../assets/data/projects.json";

const Demo = () => {
    const navigate = useNavigate();
	const [project, setProject] = useState(null);

	const { slug } = useParams();
	useEffect(() => {
        let proj = projectsJSON.find((project) => project.slug === slug)
        if(!proj){
            navigate('/projects')
        }else if(proj.demo){
        navigate(`/projects/${proj.slug}/demo`)
        }
		// setProject(projectsJSON.find((project) => project.slug === slug));
	}, [slug,navigate]);

	if (!project) return <navigate to='/projects/:slug'/>;

	return <h>The {slug} demo</h>;
};
export default Demo;
